import Footer from './Footer';

const layoutStyle = {
  //margin: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const FooterLayout = props => (
  <div style={layoutStyle}>
    <Footer />
    {props.children}
  </div>
);

export default FooterLayout;
